import styled from 'styled-components';


const Head = styled.div`
    box-shadow: -6px -6px 9px #ffffff, 6px 6px 9px rgba(0, 0, 0, 0.4);
    max-width: 1000px;
    height: 100px;
    margin: 0 auto 20px auto;
    background-color: #c3c3c3;
`;

export default function Header() {
    return (

        <div>
            <Head></Head>
        </div>

    );
}
